import './App.css';
import Nav from './nav'
import Home from './home'
import OurService from './ourService'
import About from './aboutUs'
import Work from './ourWork'
import Tool from './tools'

function App() {
  return (
    <div>
        <Nav/>
        <Home/>
        <OurService/>
        <About/>
        <Work/>
        <Tool/>

    </div>
  );
}

export default App;
